import React from "react";
import {UseAuth} from "../../context/AuthContext";
import {useNavigate} from "react-router-dom";


const Home = () =>{
    const {logOut, user} = UseAuth();
    const navigate = useNavigate();
    const handleSignOut = async () =>{
        try{
            await logOut();
        }catch (error){
            console.log(error);
        }
    };

    useEffect(() =>{
        if(user != null){
            navigate('/')
        }
    },[user]);



    return(
        <div>
            <h1>helo</h1>
            <button  onClick={handleSignOut} className='border'>LogOut</button>
        </div>
    )


}
export default Home;
